import React, { Component } from 'react';
import { Layout, Menu, Breadcrumb } from 'antd';
import ReactDOM from 'react-dom';
import logo from './images/logo.png';
import './home.css';
import styled from 'styled-components';
import { Input } from 'antd';

const Search = Input.Search;

const Container = styled.div`
  width: 100%;
  height: 60px;
  background-color: #2E9AFE;
  display: flex;
  flex-direction: row;
  justify-content: center;
`;

const LeftContainer = styled.div`
  display: flex;
  flex-direction: row;
  justify-content: center;
  align-items: center;
  width: 30%;
  left: 40px;
`;

const RightContainer = styled.div`
  display: flex;
  flex-direction: row;
  justify-content: right;
  align-items: center;
  width: 70%;
  
  
`;

const PageLink = styled.a`
  padding-right: 10px;  
  font-size: 20px;
  text-decoration: none;
  color: white;
  padding-right: 20px;
  margin-left: 65px;
  
`;

class Home extends Component {
  state = {
    current: ""
  };

  handleClick = e => {
    this.setState({
      current: e.key
    });
  };
  render() {
    return (
      <div>
      <Container>
        <LeftContainer>
        <PageLink href="/home" title="Tamaqtan" className="logo">TAMAQTAN</PageLink>    
        </LeftContainer>


        <RightContainer>    
          <PageLink href="/home" title="Главная">Главная</PageLink>      
          <PageLink href="#" title="Рецепты">Рецепты</PageLink>
          <PageLink href="#" title="Супер поиск">Супер поиск</PageLink>
          <PageLink href="#" title="Вход" className="vhod">Вход</PageLink>
        </RightContainer>
      </Container>

    
    <div>
      <Search
      placeholder="input search text"
      onSearch={value => console.log(value)}
      enterButton/>
    <br /><br />
    </div>,
  mountNode
    </div>
    
    
    );
  }
  
}

export default Home;
